	MOVWLZX (AX)(DI*1), CX
	MOVBLZX 2(AX)(DI*1), BP
	SHLL    $0x10, BP
	ORL     BP, CX
	ADDQ    $0x03, DI
	JMP     shiftControl

twoByte:
	MOVWLZX (AX)(DI*1), CX
	ADDQ    $0x02, DI
	JMP     shiftControl

oneByte:
